import React from 'react';
import './MyButton.css';

interface MyButtonProps {
  image: string;
}

const MyButton: React.FC<MyButtonProps> = ({ image }) => {
  return (
    <a href="#" className="my-button">
      <img src={image} alt="Button" className="my-button-image" />
    </a>
  );
};

export default MyButton;
